import React, { Component } from 'react';
import {connect} from 'react-redux';
import {loadCertificationByperiodId,loadCertificationByOptions}  from '../../../redux/actions/certificationActions';
import {Field, reduxForm, formValues} from 'redux-form';
import { debounce } from 'lodash';
import {
    Row,
    Col,
    Card,
    CardHeader,
    CardBody,
    CardFooter,
    ListGroup, ListGroupItem, ListGroupItemHeading, ListGroupItemText,
    Button,

  } from 'reactstrap';
  const moment = require('moment');
  moment.locale('th');
  
import renderCheckbox from '../../../components/Certification/renderCheckbox';
import logo from '../../../../public/img/log2o.png';

import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

pdfMake.vfs = pdfFonts.pdfMake.vfs;

pdfMake.fonts = {
  THSarabunNew: {
    normal: 'THSarabunNew.ttf',
    bold: 'THSarabunNew-Bold.ttf',
    italics: 'THSarabunNew-Italic.ttf',
    bolditalics: 'THSarabunNew-BoldItalic.ttf'
  }
}

const alertify = require('alertify.js')


 class  Generate extends Component {
    constructor(props){
            super(props)
            this.HookCertification = this.HookCertification.bind(this)
            this.GeneratePDF = this.GeneratePDF.bind(this);
    }
    componentDidMount(){
        this.props.dispatch(loadCertificationByperiodId(this.props.match.params.period_id))
    }
    GeneratePDF(data){
        var documentname = new Date();
        documentname = documentname.getTime();
        var docDefinition = {

          info: {
            title: documentname,
            author: 'COMCENTRE LPRU',
            subject: 'subject of document',
            keywords: 'keywords for document',
          },
            pageSize:'A4',
            pageOrientation: 'portrait',
            defaultStyle:{
              font:'THSarabunNew'
            },
            content:[]
        };
      
          {data &&  data.map((e,i)=>{
            docDefinition.content.push(
            {text:'เลขที่ '+e.iat, fontSize:16},
            {image:'data:image/png;base64,',alignment:'center',width:180},
            {text:'ศูนย์คอมพิวเตอร์',fontSize:20, bold:true, alignment: 'center'},
            {text:'มหาวิทยาลัยราชภัฏลำปาง',fontSize:20, bold:true,  alignment: 'center'},
             {text:'ขอมอบวุฒิบัตรฉบับนี้ให้ไว้เพื่อแสดงว่า',fontSize:18, alignment:'center'},
            {text:e.fullname ? e.fullname : 'เกิดข้อผิดพลาด ไม่พบข้อมูล',fontSize:18, alignment:'center'},
            {text:'ได้ผ่านการอบรม หลักสูตร'+` "${e.course_name}" `,fontSize:18, alignment:'center'},
            {text:`ในวันท่ี ${moment(e.per_end).add(543, 'years').format('ll')}`,fontSize:18, alignment:'center'},
            {text:`ให้ ณ วันที่ ${moment(e.per_end).add(543, 'years').format('ll')}`,fontSize:18, alignment:'center'},
            {text:`ขอให้เจริญสุขสวัสดิ์ ประสบผลดีสำเร็จสืบไป`,fontSize:18, alignment:'center'},
            {
              columns: [
                {text:'(ผู้ช่วยศาสตราจารย์ไพจิตร สุขสมบูรณ์)', fontSize:16, alignment:'left',margin:[40,0,0,0]},
                {text:'(รองศาสตราจารย์ ดร.สมกเกียรติ สายธนู)', fontSize:16, alignment:'right'}
              ],
              margin:[0,20,0,0]
            },
            {
              columns: [
                {text:'ผู้อำนวยการสำนักวิทยบริการและเทคโนโลยีสารสนเทศ', fontSize:16, alignment:'left'},
                {text: 'อธิการบดีมหาวิทยาลัยราชภัฏลำปาง', fontSize:16, alignment:'right', margin:[0, 0, 13, 0]}
              ],
            }
          )
              
          })
          console.log(docDefinition);
          {docDefinition.content && pdfMake.createPdf(docDefinition).open()}
        }
    }
      HookCertification(values){
      const {certificationsbyoptions} = this.props
      if(Object.keys(values).length === 0 && values.constructor === Object){
          alertify.alert('Please select at least 1 person')
      }else{
              var data = {};
              var i = 0;
             for(var key in values){
                  if (values[key]) {
                    data[i] = key.replace('cert_',"");
                }
                i++;
             }
             
             this.props.dispatch(loadCertificationByOptions(data))
         

      }
    }

  render() {
     const {certificationperiod,handleSubmit,certificationsbyoptions} = this.props
      if(certificationsbyoptions.data){
        this.GeneratePDF(certificationsbyoptions.data)
      }
      
    return (
      <div className="animated fadeIn">
        <Row>
        <Col md="3">
            <Card>
              <CardHeader>
                <i className="fa fa-certification"></i><strong>Action</strong>
              </CardHeader>
              <CardBody>
                  <Row>
                    <Col>
                    <Button onClick={handleSubmit(this.HookCertification)}color="success" block><i className="fa fa-print"></i>{'\u00A0'}พิมพ์ใบวุฒิบัตร</Button>
                    </Col>
                    </Row>
              </CardBody>
            </Card>
          </Col>
          <Col md="6">
            <Card>
              <CardHeader>
                <i className="fa fa-certification"></i><strong>รายชื่อผู้ที่ได้รับวุฒิบัตร</strong>
              </CardHeader>
              <CardBody>
                <ListGroup>
                  <form>
                 {certificationperiod && certificationperiod.data && certificationperiod.data.map((e,i)=>{
                     return(
                        <ListGroupItem action key={i}>
                        <Row>
                        <Col md="11">{e.username}{' '}{e.fullname} ใบวุฒิบัตรเลขที่ {e.cert_id}{e.iat}</Col>
                          <Col md="1"><Field component={renderCheckbox} name={"cert_"+e.cert_id} type="checkbox" value={e.cert_id} /></Col>
                        </Row>
                        </ListGroupItem>
                     )
                 })}
                 </form>
                </ListGroup>
              </CardBody>
            </Card>
          </Col>
        </Row>
      </div>
    )
  }
}
const form = reduxForm({
  form:'Generate'
})

function mapStateToProps(state){
    return {
        certificationperiod:state.certificationReducers.certificationperiod,
        certificationsbyoptions:state.certificationReducers.certificationsbyoptions
    }
}
Generate = connect(mapStateToProps)(Generate);
export default Generate = form(Generate)
 